INSERT INTO `article_comment` VALUES (15,1,3,'好文 讚喔','2023-05-26 14:34:51'),(18,1,2,'太感謝了 正想規劃台南旅行','2023-05-26 15:39:14'),(19,1,2,'好文，精闢','2023-05-26 20:48:21'),(20,1,2,'感謝分享~~','2023-05-26 20:50:02'),(21,2,2,'市區的捷運、公車、公共腳踏車(U bike)很方便，你想去的這些地方距離都不遠，我認為這些行程可以。','2023-05-30 21:44:23'),(22,9,1,'qqwwwww','2023-05-30 21:44:59'),(24,1,3,'求一個 台東版攻略','2023-06-02 19:21:00'),(25,3,1,'周日往宜蘭估計0800~11:00 應該還是會稍塞 其他時間應該就還好 注意安全有耐心 不會難開的','2023-06-04 00:55:08'),(26,3,1,'的確是有塞車的可能.如果擔心塞車可以考慮搭火車 到宜蘭再搭計程車就可以了.','2023-06-04 00:55:51'),(27,2,3,'第一交通不是很方便，第二裡面根本沒什麼動物，你可以先上網查一下官網介紹就可以有個想法了','2023-06-04 00:59:44'),(28,4,3,'2022年底， 在此用餐，很推.....  部落炭烤 950台東縣台東市新生路3號','2023-06-04 01:06:12'),(29,5,1,'南豐鐵花棧到池上開車一個小時,覺得沒有差到什麼','2023-06-04 01:12:41'),(30,5,1,'因為池上晚什麼都沒有,要看個人喜好吧,有要去南橫嗎?有的話覺得住一個晚上就可以了吧','2023-06-04 01:12:43'),(31,5,1,'您好，請問你的台東之行已圓滿完成了嗎，是否可以分享一下！XD','2023-06-04 01:14:13'),(32,7,1,'花蓮：我會選擇去太魯閣國家公園，住一天。並去走一趟錐鹿古道。','2023-06-04 01:28:28'),(33,7,1,'台東：我會去池上騎腳踏車，及 去台東森林公園。','2023-06-04 01:28:31'),(36,16,2,'你有預計日期嗎?','2023-06-06 10:10:15'),(39,1,4,'+1 求台東攻略~','2023-06-06 22:09:43'),(40,1,4,'有人想糾團嗎?','2023-06-06 23:03:10'),(41,15,3,'離飯店比較近的是礁溪溫泉公園，有足湯，有一些幾米的畫作雕像可','2023-06-07 01:41:42'),(42,1,1,'感謝支持~~','2023-06-07 23:16:13'),(43,5,4,'同上 可否分享一下~','2023-06-07 23:21:48'),(44,16,1,'有想騎機車環島，走南橫','2023-06-07 23:29:00'),(45,15,3,'以拍照 比較遠一點的是礁溪街上的湯圍溝溫泉公園，不過有點年久失修的破落感','2023-06-07 23:31:38'),(46,2,1,'OK我在GOOGLE看看~ 感謝解答','2023-06-07 23:56:58');
