--
-- Table structure for table `com_to_admin`
--

DROP TABLE IF EXISTS `com_to_admin`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `com_to_admin` (
  `C2A_MSG_ID` int NOT NULL AUTO_INCREMENT COMMENT 'C2A 訊息編號',
  `C2A_SENDER_ID` int DEFAULT NULL COMMENT '發信商家編號',
  `C2A_RECEIVER_ID` int DEFAULT NULL COMMENT '收件平台編號',
