INSERT INTO `public_scene` VALUES (1,1,'幾米公園',NULL,'「幾米主題廣場」位於宜蘭火車站南側，原為廢棄的鐵路局舊宿舍區，後經過重新規劃整建，除了保留原有的歷史建築與老樹綠蔭外，更以「記憶片刻風景」為主題，置入取自知名繪本作家「幾米」的場景所製成的裝置藝術，包含「向左走‧向右走」、「星空」…等繪本中的著名場景，都在此原貌重現。不但已成為拍照的著名場景，更是全台第一座幾米主題廣場。','260宜蘭縣宜蘭市宜興路一段240號','24.752733529527834','121.75705744620144','ChIJdTXpxtvkZzQRYSmxKq3qjSI'),(2,1,'大稻埕碼頭',NULL,'早期的大稻埕，原是平埔族的居住地，後來因萬華同安人發生激烈的械鬥，許多人便移至大稻埕定居，此後，這裡便成為台北盆地內的物資集散中心，與重要的外貿重要地點，當地的領事館、洋行、商號雲集，茶館、茶行林立，這裡便成了當時全口最大的茶葉、樟腦交易中心，今日的大稻埕，仍可在街道裡看出一些些的遺留下的歷史記錄，而碼頭更經常成為演出活動的舉辦地點，我相信這裡將永遠不會被人們所遺忘。','台北市大同區長安西路39號','25.050754681647852','121.51912729848034','ChIJc-TxSWypQjQR-8Eh7elK97Q'),(3,1,'台北當代藝術館',NULL,'「台北當代藝術館」位於台北市大同區的中山捷運站附近，交通便捷，所在的建築物建於1921年，歷史悠久，為日治時期專門供給日人子弟受教育的「建成小學校」。面寬有120公尺寬的兩層樓建築，採紅磚壁與木材屋架，並結合了西方建築柱式與黑瓦斜屋頂，融合了中西方的建築特色，打造出U字型的校舍建築與空間。\n \n		1945年後，建成小學校舍就被轉用為新成立的台北市政府辦公廳舍，近五十年的時間這棟建築扮演著台北市政府的運轉中樞角色，2001年後這棟已成為市定古蹟的舊市府被重新修復、再次打造成「台北當代藝術館」。\n \n		台北當代藝術館將藝術、古蹟、科技三者做了巧妙的結合，辦理多檔精采絕倫且豐富多元的當代藝術展覽，成為了台北市藝文發展的重要據點，並且提供了互動性且整合度強的展覽平台，鼓勵多元面貌的藝術創作，開拓出極具前瞻性與創意的新文化思維。\n \n		【參觀須知】\n		1. 請勿於展場內高聲談笑、追逐嬉戲、飲食、吸煙及拋棄紙屑、雜物。\n		2. 請勿於展場內使用行動電話進行談話。		\n		3. 服裝不整、攜帶寵物者謝絕進入參觀。\n		4. 本館目前全面開放攝影，為維護現場觀展品質，請勿使用閃光燈、腳架以及錄影，展場工作人員亦不提供攝影服務，不便之處敬請見諒。同時請尊重藝術家之智慧財產權及作品版權所有。','103台北市大同區','25.05683468082164','121.5078571238404','ChIJx4IVtBapQjQRSP3RxLSLdg0'),(4,1,'十分老街',NULL,'「十分老街」為天燈的發源地，堪稱平溪礦業史中開發最早、規模最大的聚落。十分老街和火車鐵軌並存相連，不但擁有「火車門前過」的獨特鐵道風貌，更是歌手MV、電影的取景勝地。今日老街仍保有舊時的建築風貌，飲食店、天燈工藝品店林立，展現新生機。','226新北市平溪區十分街81號','25.043737922631802','121.77701902276414','ChIJ_____y9RXTQRvnNyOkDE3vY'),(5,1,'猴硐貓村',NULL,'猴硐貓村位於台灣新北市瑞芳區侯硐車站週邊，以光復里柴寮路一帶為中心的山村民宅古街。\n　\n猴硐地區以兩處平溪線鐵路畫分為兩大景點，一為「猴硐坑礦產園區」，另一個就是「猴硐貓村」。由於貓村在早期便聚集許多貓咪在此棲息，加上貓咪繁殖力強，此處竟成了貓咪棲息地。於是在2009年10月31日透過愛貓人士們發起「有貓相隨，侯硐最美」的活動後，貓咪的居住環境煥然一新。\n　\n在抵達台鐵猴硐站後，一出站即可在車站天橋上看到許多與貓鄉關的看板，也提供貓村導覽圖方便遊客遊覽，一路上更有許多可愛的招牌，像是「小心貓出沒」，十分有趣。猴硐車站內也販售各式與貓咪鄉關的週邊商品，這些可愛的商品，絕對讓來訪的遊客們充滿訝異！\n　\n貓村的貓咪可與遊客親近，許多愛貓人士都會到此為貓咪們拍下可愛的照片，若是您也愛貓咪，因為白天較為炎熱，且貓咪們屬夜行性，故貓群多會隱匿於陰涼處，傍晚後較容易看見大量貓隻群聚的景況。想與貓咪們親近，「猴硐貓村」十分適合喔！','224新北市瑞芳區','25.087272774093876','121.82680583297034','ChIJPU_4MvZPXTQR0BJpGnJlaPs'),(6,1,'司馬庫斯神木群',NULL,'司馬庫斯位於台灣東北角雲霧盛行的地區，海拔約1600公尺間，又名「黑色部落」，當地以紅檜巨木林區聞名全省，由部落前往原始林，約需二小時腳程，來到紅檜巨木林區，您可以看到有號稱「神木大老爺」的巨人神木，樹齡約2500年，樹圍20.5公尺，樹高約35公尺，其最大特色為「人」字的樹型，因神木群的發現吸引了許多人潮，也成為檜木的故鄉。','313新竹縣尖石鄉玉峰村14鄰司馬庫斯2號','25.043737922631802','121.77701902276414','ChIJTU3dkCNpaDQRVrkLhSsAGCE'),(7,1,'霧峰落羽松秘境',NULL,'仿若一張屬於大自然的畫布...\n隨著季節的變換，四週稻田又收割了，自然的大師是又創作一幅新作。\n沿路隨著陽光灑落的繽紛、光影的浪漫，帶來的到底是楓落惆悵的心情還是戀人不安的情緒...\n\n台中霧峰落羽松林原為一處不為人知的美麗秘境，隱身於一片稻田間，仿若北國風情畫、冬季戀歌的浪漫場景般。若要抵達美麗秘境，就必須要步行橫越一片稻田。這片落羽松為私人種植，原本並不是一個公開的景點，但冬日來到時，落羽松的綠再大片的楓紅的點綴下、經過媒體報導，吸引人潮前往朝聖、熱門打卡的新地標，落羽松秘境儼然成為一處新亮點。\n\n貼心小提醒\n※美麗需要大家的公德心維護，留下足跡、但請帶走垃圾。\n※雨後落羽松林十分美麗，但積水處處，請穿上好走的鞋子避免滑倒。','421台中市后里區安眉路5號','24.32576192302774','20.74937566387499','ChIJR4hC-y4FaTQRRoW5VIOlblk'),(8,1,'薰衣草森林台中新社店',NULL,'「薰衣草森林」是由兩個懷抱著紫色夢想的女孩子所創立，在台北外商銀行工作六年的詹慧君，與來自高雄的鋼琴老師林庭妃，兩人在接觸過來自西方的香藥草一段時間後，一直很希望擁有一畝薰衣草田，讓自我的身心在純樸的生活中得到安靜。\n \n於是，帶著全身的家當，兩人來到台中新社的中和村，這裡有很多樹、很多山，層巒疊嶂的蓊鬱山林穿插梅花、山櫻花、野薑花、檳榔花、桃花等四季花卉，山上散居的二十多戶人家就與螢火蟲、野兔、大冠鷲、竹雞快樂的生活著，兩人與園主王媽媽一家人除草、整地、挖土、排列步道、蓋房子，一磚一瓦親手打造出自己的夢想天地，旅客可以沿著小路緩慢上山，體驗簡單樸石的山居生活，認識、照顧香草植物，或是手作餅乾與香草料理，嘗試都市所沒有的全新體驗。','426台中市新社區中興街20號','24.13037158745358','120.84166587556177','ChIJD9GIn30faTQRIp0yWTjPWoM'),(9,1,'黃金海岸',NULL,'黃金海岸位於台南市南區，為台南市最美麗的海岸，是市民休閒的好去處，海岸線長達5公里多，假日經常可看到許多人放風箏、玩沙雕、在海邊戲水，來一趟黃金海岸就能親自感受得到這麼美麗的景象。\n\n			在這美麗的海岸裡，還需要我們一起來愛護它、保護它的生態，讓這樣別具南洋熱帶風味的海岸永遠存在。','702台南市南區西部濱海公路','22.941213449638703','120.1811792959222','ChIJMTD9H3J1bjQRC0l1HyDH3rQ'),(10,1,'安平古堡',NULL,'西元1624年為荷蘭人建造，台灣第一座城堡「熱蘭遮城」。西元1661年，鄭成功將此地改名為安平，熱蘭遮城也稱為「王城」或「臺灣城」，俗稱安平古堡。今台南市安平區國勝路82號。\n\n今日的紀念館風貌，邊殘存七十多公尺長的外城南牆殘壁依然屹立，老榕攀爬，紅磚班駁，是300餘年來僅存的歷史遺跡，訴說著曾經過往的滄桑。光復後改名為安平古堡，並成為一級古蹟和觀光勝地，目前紀念館。','708台南市安平區國勝路82號','23.001596826835847','120.16071654426187','ChIJZ-TjeHN2bjQR8a3Jat0VHps'),(11,1,'四四南村',NULL,'「四四南村」為台北市第一個眷村，由於位在陸軍庫房聯勤第四十四兵工廠的南邊因而命名。也因位居台北信義區都更重鎮，被迫歷經多次拆除計畫。直自1999年火災後，為將代表性的建築留作眷村文化的縮影，在多數人聯署之下加以重整保留，部分房舍更改建成「信義公民會館」，包含特展館、眷村展示館、展演館、社區館、四四廣場及文化公園等多元化展覽用途。','110台北市信義區松勤街52號','25.031781207454415','121.56186823110295','ChIJKbvNcgurQjQRipN6qlqqDdY'),(12,1,'艋舺龍山寺',NULL,'萬華龍山寺落成於清乾隆五年(西元1740年)，歷史悠久的龍山寺將過多次的重建，寺廟中的主祀神祇為觀世音菩薩，並供奉有註生娘娘、文昌帝君、城隍爺、地藏王菩薩及媽祖等眾多神祇。龍山寺佔地一千八百多坪，整體建築格局為「日」字型，是三進四合院的傳統宮殿建築，分為前殿、正殿、後殿及左右護龍，廣場前部分石板是早期自中國渡海來台用來壓艙的石板，殿前有一對在台灣獨一無二的銅鑄龍柱，廟宇外觀氣派富麗堂皇，擁有彩繪、木刻、石雕及剪黏等精湛的工藝裝飾，為國家二級古蹟，除了是當地民眾的信仰中心，也是盛名於全台灣頗具威望的廟宇。','108台北市萬華區廣州街211號','25.037300857151326','121.49991903877596','ChIJCd7n16ipQjQRihzEWF4z6Pg'),(13,1,'水源市場',NULL,'水源市場位於台北市的中正區，鄰近捷運公館站一號出口，早期因為位於水道町（又稱水源地）得名。一、二樓目前做為市場使用，結合週邊的流動攤販，是公館商圈的重要鬧區。','100台北市中正區羅斯福路四段92號','25.01380231889983','121.53502588110221','ChIJ_fgu74qpQjQRDbsRG5E7Fgs'),(14,1,'袖珍博物館',NULL,'袖珍博物館成立於86年3月28日，佔地約200坪，是亞洲第一座專門收藏當代袖珍藝術品的主題博物館，博物館由林文仁夫婦因為被娃娃屋的魅力，進而投身袖珍世界。','104台北市中山區建國北路一段96號B1','25.0505570526104','121.5361120387765','ChIJbVjU3GGpQjQRf-842jJJufc'),(15,1,'圓山文化遺跡',NULL,'圓山為臺北盆地之獨立小丘，在臺北盆地仍為湖泊時，圓山為湖邊之小島，據日據時期之考古發掘，證實史前曾有人類活動，在山腰發現之無數貝殼，主要種類為烏蜆殼、蠔殼、鐘螺殼及川蜷螺等半鹼性和海棲性貝殼類，為史前人類食後所棄，稱為貝塚。民國四十三年〈1954年〉曾由學術單位進行發掘，發現上層有陶器、石器、骨器、及角器等出土，定名為圓山文化。但下層又發現繩紋陶，定名為繩紋陶文化，又名大坌坑文化，為臺灣較早的新石器時代文化。','104台北市中山區玉門街1號','25.073370469878466','121.52340246575916','ChIJFRvPF0ypQjQROM3-TuF0kcc'),(16,1,'內溝溪生態展示館',NULL,'內溝溪生態展示館於93年7月10日開幕啟用，一樓設有內溝溪流域環境地形模型（1/500比例尺）及陳列昔日內溝地區產業樣品，並有內溝當地生態圖片及標本，配合志工解說，讓參訪民眾瞭解內溝溪周邊環境及當地人文歷史和生態。二樓係以自然生態為主題的圖書館及放映室，播放內溝溪整治紀錄片、生態影片等，是鄉土教育的最佳題材。由於森林植物物種豐富，因此賴此植被生存的生物也多樣化，蟲魚鳥獸悠游其中，成為一座自然生態戶外教室。','114台北市內湖區康樂街236之3號','25.08780002708893','121.62303767927449','ChIJtXNmAtKsQjQRVS7vQCrlHjc'),(17,1,'士林官邸公園',NULL,'民國三十九年先總統　蔣公將官邸設立於此，早期一般民眾鮮少接近，在時光變遷之下，民國八十五年時正式開放民眾參觀，成為台北市區中的另一處景點。士林官邸主要分為外花園、內花園及正房，建有栽種蘭花的溫室盆栽區、蔣夫人喜愛的玫瑰園、蔣家人做禮拜及受洗的凱歌堂、中式四角狀的新蘭亭及兩層樓高的慈雲亭，園區內規劃良好草木扶疏，蘭花及玫瑰盛開時美不勝收，更於每年三、四月份策劃士林官邸玫瑰季，吸引許多民眾前來參觀。','111台北市士林區中山北路五段460巷4號','25.091588202070216','121.52921784431632',' ChIJGbWNq1OvQjQR1HoXIbC0hF4'),(18,1,'ssssss',NULL,'www','wwwww','w','w','w'),(19,1,'eeeeeeeeee',NULL,'eeeeeee','www','ww','w','ww');
