INSERT INTO `room` VALUES (1,1,'日月潭日暮山景雙床房',9000,'細膩規劃出9坪的簡約空間，讓山林富含的芬多精，隨意飄散在輕鬆假期。','2023-06-09',0,0,1,0,1,0,5,'雙人房',2,1,NULL),(2,1,'日月潭映月經典和洋房',10000,'寧靜且富饒的漁村景致，讓您滿足且貪戀眼前所得到的感動雲影與湖光的交錯','2023-06-09',1,0,1,1,1,1,5,'雙人房',2,1,NULL),(3,1,'日月潭雅緻湖景套房',12000,'房內以木質地板延伸至戶外的湖景嚮往，給您水天一色的釋然空間。','2023-06-09',0,1,1,0,1,0,10,'單人房',1,1,NULL),(4,1,'日月潭雅緻湖景四人房',15000,'輕觸在悠然自得的湖光水色，一彈一指間的沈迷放肆與您眼前那一片垂手可得','2023-06-09',0,0,0,1,1,1,10,'四人房',4,1,NULL),(5,2,'台中麗寶閃亮星空',30000,'夢幻的星空裡有著無數顆星星，只要對著房間壁貼上最大顆的星星許願，今晚就會甜甜進入夢鄉','2023-06-09',0,0,1,0,1,0,5,'四人房',4,1,NULL),(6,2,'台中麗寶美味魔法師',25000,'咻~熊大的魔法棒一揮，變出了許多美味可口的甜點讓你一進房就會不自覺想流口水','2023-06-09',1,0,1,1,1,1,10,'雙人房',2,1,NULL),(7,2,'台中麗寶航海冒險',15000,'以藍白色調為基底的海洋風，象徵每次出發都會有個最棒的開始，給你無限的勇氣和力量。','2023-06-09',0,1,1,0,1,0,3,'四人房',4,1,NULL),(8,2,'台中麗寶浪漫滿屋',20000,'為她/他製造一點點浪漫及驚喜，是生活中必備的儀式感，把日子詮釋成自己喜歡的樣子','2023-06-09',0,0,0,1,1,1,4,'雙人房',2,1,NULL),(9,3,'墾丁一樓標準海景房',10000,'陽光灑落、鳥鳴歡笑與您迎接美好早晨，通過綠草廊道直達泳池，享受旅人悠閒自在。','2023-06-09',0,0,1,0,1,0,3,'單人房',1,1,NULL),(10,3,'墾丁二樓家庭海景房',20000,'簡單無華的純淨空間，有著木質溫潤感受，讓您一掃煩雜瑣事，輕鬆自在的寫下幸福篇章。','2023-06-09',0,1,1,0,1,0,5,'四人房',4,1,NULL),(11,3,'墾丁三樓雙人山景房',15000,'時尚恬靜的舒適客房，軟綿的床鋪猶如飄逸藍天中的雲朵，匯集成墾丁美好時光','2023-06-09',0,0,0,1,1,1,10,'雙人房',2,1,NULL),(12,4,'101日暮山景獨佔房',9000,'細膩規劃出9坪的簡約空間，讓山林富含的芬多精，隨意飄散在輕鬆假期。','2023-06-09',0,0,1,0,1,0,2,'單人房',1,1,NULL),(13,4,'101日暮山景雙床房',10000,'寧靜且富饒的漁村景致，讓您滿足且貪戀眼前所得到的感動雲影與湖光的交錯','2023-06-09',0,0,1,0,1,0,2,'雙人房',2,1,NULL),(14,4,'101日暮山景四床房',13500,'輕觸在悠然自得的湖光水色，一彈一指間的沈迷放肆與您眼前那一片垂手可得','2023-06-09',0,0,1,0,1,0,1,'四人房',4,1,NULL),(15,5,'新光閃亮星空',15000,'以藍白色調為基底的海洋風，象徵每次出發都會有個最棒的開始，給你無限的勇氣和力量。','2023-06-09',0,0,1,0,1,0,2,'單人房',1,1,NULL),(16,5,'新光美味魔法師',25000,'咻~熊大的魔法棒一揮，變出了許多美味可口的甜點讓你一進房就會不自覺想流口水','2023-06-09',0,0,1,0,1,0,2,'雙人房',2,1,NULL),(17,5,'新光航海冒險',30000,'夢幻的星空裡有著無數顆星星，只要對著房間壁貼上最大顆的星星許願，今晚就會甜甜進入夢鄉','2023-06-09',0,0,1,0,1,0,1,'四人房',4,1,NULL),(18,6,'大甲一樓標準海景房',10000,'陽光灑落、鳥鳴歡笑與您迎接美好早晨，通過綠草廊道直達泳池，享受旅人悠閒自在。','2023-06-09',0,0,1,0,1,0,1,'單人房',1,1,NULL),(19,6,'大甲二樓雙人海景房',20000,'簡單無華的純淨空間，有著木質溫潤感受，讓您一掃煩雜瑣事，輕鬆自在的寫下幸福篇章。'